import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import ReactPlayer from 'react-player'
import juliasession from './videos/julia_session_nv.mp4'
import nancysession from './videos/nancy_session_nv.mp4'
import audio from './videos/discussion_nv.m4a'
import Fab from '@material-ui/core/Fab';
import RoomIcon from '@material-ui/icons/Room';
import CallEndIcon from '@material-ui/icons/CallEnd';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import { Typography, Button } from '@material-ui/core';
import Tooltip from '@material-ui/core/Tooltip';


const useStyles = makeStyles({
  root: {
    display: 'flex',
    alignItems: 'center',
  },
});

export default function Call () {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <Grid container alignItems="center">
      <Grid
      container
      direction="row"
      justify="center"
      alignItems="flex-start"
      >
        <div>
          <Paper>
        <ReactPlayer
        playing='true'
        url= {juliasession}
        />
        <Typography variant='subtitle1' align='right'>Julia Rogers</Typography>
        </Paper>
        <Tooltip variant='' title="Pinned at 0:30" placement="top">
        <Fab color="primary" aria-label="add">
          <RoomIcon />
          </Fab>
          </Tooltip>

        </div>
        <ReactPlayer
        playing='true'
        url= {nancysession}
        width='10%'
        height='10%'
        />

        </Grid>
        <Grid item xs={6}>
        </Grid>
        <Grid item>
        <Button variant="contained" color="secondary" startIcon={<CallEndIcon fontSize="large" />} className={classes.margin}>
          Begin Discussion Prep
        </Button>
        </Grid>

        </Grid>

    </div>
  )}
